<p>铁路运输具有运输能力比较大，运输速度比较快，运输成本比较低，发展性可靠性比较高，受天气条件影响比较小，并具有占地少，能耗低，污染小等特点。铁路运输适合稳定的大宗货运输，特别是中长途货物运输，也适合中长途短途成绩和高速旅客运输。</p>
